import { useState } from 'react';
import { Button } from "@primer/react";

const EmojiReact = (props) => {
    const [count, setCount] = useState(1);

    const handleClick = () => {
        setCount(count + 1);
    };

    return(
        <Button onClick={handleClick()}>{`❤️ ${count}`}</Button>
    )
}

export default EmojiReact;
